import React from 'react';
import styled from '@emotion/styled';

function Nav() {
    return (
        <NavPane>
            <NavList>
                
                <NavItem>PROJECTS</NavItem>

            </NavList>
        </NavPane>
    )
}

export default Nav;

const NavPane = styled.nav`
width:100vw;
grid-area: nav;
margin: 0;
color: crimson;
@media (min-width: 600px) {
    margin: auto;
    width: 70%;
}
`;

const NavList = styled.ul`
    display: flex;
    flex-direction: row;
    list-style: none;
    justify-content: space-around;
`;

const NavItem = styled.li`
cursor: pointer;
padding: 0.3rem;
border-radius: 0.5rem;
font-weight: bold;
justify-self: right;
:hover {
    color: white;
    background-color: crimson;
}
`;
